import React from 'react';

const Loader = () => {
    return (
        <div className="pl">
            <svg className="pl__ring" xmlns="http://www.w3.org/2000/svg" width="100" height="100" viewBox="0 0 100 100">
                <circle className="pl__ring--a" cx="50" cy="50" r="40" fill="none" strokeWidth="6" />
                <circle className="pl__ring--b" cx="50" cy="50" r="30" fill="none" strokeWidth="6" />
                <circle className="pl__ring--c" cx="50" cy="50" r="20" fill="none" strokeWidth="6" />
                <circle className="pl__ring--d" cx="50" cy="50" r="10" fill="none" strokeWidth="6" />
            </svg>
        </div>
    );
};

export default Loader;
